    "# Plot the historical temperature data\n",
    "plt.figure(figsize=(10,6))\n",
    "plt.plot(df['date'], df['temperature_C'], label='Temperature (°C)', color='tab:red')\n",
    "plt.title(\"Historical Temperature in Kimberley (2022-2024)\")\n",
    "plt.xlabel(\"Date\")\n",
    "plt.ylabel(\"Temperature (°C)\")\n",
    "plt.grid(True)\n",
