    "# Coordinates for Kimberley, South Africa\n",
    "latitude = -28.74\n",
    "longitude = 24.77\n",
    "start_date = '20220101'\n",
    "end_date = '20241231'\n",
    "parameters = 'T2M,PRECTOTCORR,RH2M'  # Use PRECTOTCORR instead of PRECTOT\n",
    "community = 'AG'  # Add the 'community' parameter\n",
    "\n",
    "# Build the NASA POWER API URL with the community parameter\n",
    "url = f'https://power.larc.nasa.gov/api/temporal/daily/point?parameters={parameters}&start={start_date}&end={end_date}&latitude={latitude}&longitude={longitude}&format=JSON&community={community}'\n",
    "\n",
    "# Request the data\n",
    "response = requests.get(url)\n",
    "data = response.json()\n",
    "\n",
    "# Debug: check the response content\n",
    "if 'properties' not in data:\n",
    "    print(\"❌ Error: 'properties' not found in response.\")\n",
    "    print(\"Full response from NASA POWER API:\")\n",
    "    print(data)\n",
    "else:\n",
    "    # Extract the daily data\n",
    "    daily_data = data['properties']['parameter']\n",
    "    dates = list(daily_data['T2M'].keys())\n",
    "\n",
    "    # Build the DataFrame\n",
    "    df = pd.DataFrame({\n",
    "        'date': pd.to_datetime(dates),\n",
    "        'temperature_C': list(daily_data['T2M'].values()),\n",
    "        'precipitation_mm': list(daily_data['PRECTOTCORR'].values()),  # Use PRECTOTCORR\n",
    "        'humidity_%': list(daily_data['RH2M'].values())\n",
    "    })\n",
    "\n",
    "    # Show the first few rows\n",
    "    print(\"✅ Weather data loaded successfully:\")\n",
    "    display(df.head())\n"
